/*
 * Listener che si occupa di gestire il click sul pulsante "Importa XML" nella GUI
 */
public class ImportaXMLActionListener implements ActionListener{

	JFrame parentFrame;

	public ImportaXMLActionListener(JFrame parentFrame) {
		this.parentFrame=parentFrame;
	}

	@SuppressWarnings("deprecation")
	@Override
	public void actionPerformed(ActionEvent e) {
		try {	   
			// Visualizzazione della finestra di selezione del file
			JFileChooser fc = new JFileChooser();
			int n = fc.showOpenDialog(parentFrame);
			RecordParser rp = new RecordParser();
			String[][] matrixTimbrature;
			// Se è stato selezionato qualcosa
	        if (n == JFileChooser.APPROVE_OPTION) {
	        		// Parsing del file XML e creazione della matrice di Stringhe che deve essere mostrata nella 
	        		// JTable della GUI 
	        		List<Timbratura> lista = rp.parserXML(fc.getSelectedFile().getAbsolutePath());
	        		matrixTimbrature = new String[lista.size()][4];
	        		for (int i=0;i<lista.size();i++) {
	        			matrixTimbrature[i][0]=lista.get(i).getDipendente().getIDBadge();
	        			matrixTimbrature[i][1]=lista.get(i).getTipo();
	        			matrixTimbrature[i][2]=String.format("%02d", lista.get(i).getData().getDate()) + "/" + 
	        					String.format("%02d", lista.get(i).getData().getMonth()+1) + "/" + 
	        					(lista.get(i).getData().getYear()+1900);
	        			matrixTimbrature[i][3]=lista.get(i).getOra().toString();	        			
	        		}
	        		// Visualizzazione della finestra di modifica degli orari
	        		((gestioneOrariView)parentFrame).openRecordMng(matrixTimbrature);
	        }
	        else {
	        		JOptionPane.showMessageDialog(null, 
	                    "Nessun file selezionato!", 
	                    "Errore operazione", JOptionPane.ERROR_MESSAGE);
	        }
		} catch (Exception ex) {
			ex.printStackTrace();
	    }
	}

}

package gestioneOrariApplication;

import java.sql.Time;
import java.util.ArrayList;
import java.util.Calendar;
import java.util.Date;
import javax.persistence.TypedQuery;
import javax.swing.JOptionPane;
import gestioneOrariData.Dipendente;
import gestioneOrariData.Orario;
import gestioneOrariData.Timbratura;

public class RecordAggregator implements Aggregator{

	/* Funzione per tutto il processo di aggregazione degli orari, a partire dalle timbrature fino ad arrivare
	 * agli orari aggregati per giorno, con già un precalcolo delle componenti di ordinario, straordinario e ferie
	 */
	@Override
	public void aggregate() {
		try {
			// Selezione della minima e della massima data
			TypedQuery<Date> queryMax = DBHandler.getEntityManager().createQuery("SELECT MAX(T.data) FROM Timbratura T",Date.class);
			TypedQuery<Date> queryMin = DBHandler.getEntityManager().createQuery("SELECT MIN(T.data) FROM Timbratura T",Date.class);
			// Creazione delle righe vuote
			creaRigheVuoteOrari(queryMax.getSingleResult(),queryMin.getSingleResult());
			// Posizionamento (aggregazione) delle timbrature nella riga corretta 
			posizionaOrari(queryMax.getSingleResult(),queryMin.getSingleResult());
			// Elaborazione degli orari per il calcolo di ordinari, straordinari, ferie e permessi
			elaboraOrari(queryMax.getSingleResult(),queryMin.getSingleResult());
			// Eliminazione di tutti i dati nella tabella delle Timbrature
			eliminaDatiTimbrature();		
			// Messaggio di conferma
			JOptionPane.showMessageDialog(null, 
                    "Operazione di importazione ed aggregazione delle timbrature completata correttamente", 
                    "Conferma operazione", JOptionPane.INFORMATION_MESSAGE);
		} catch (Exception e) {
			e.printStackTrace();
		}
	}

	/* Funzione che permette di creare le righe vuote per tutti i giorni compresi tra la minima data di
	 * importazione e l'ultima data di importazione
	 */
	public void creaRigheVuoteOrari(Date dataMin, Date dataMax) {
		// Selezione di tutti i dipendenti
		TypedQuery<Dipendente> queryDip = DBHandler.getEntityManager().createQuery("SELECT D FROM Dipendente D",Dipendente.class);
		// Per ogni dipendente e per ogni data, tra quella minima e quella massima, creazione di una riga vuota
		// nella tabella degli orari
		for(Object d:queryDip.getResultList().toArray()) {
			Date dateCur = new Date();
			dateCur=dataMin;
			while(dateCur.compareTo(dataMax)<=0) {
				Orario o = new Orario();
				o.setDipendente((Dipendente)d);
				o.setData(addDays(dateCur,1));
				DBHandler.getEntityManager().getTransaction().begin();
				DBHandler.getEntityManager().persist(o);
				DBHandler.getEntityManager().getTransaction().commit();
				dateCur = addDays(dateCur,1);
			}
		}
	}

	/* 
	 * Funzione utilizzata per l'incremento della data di un certo numero di giorni
	 */
	public static Date addDays(Date date, int days)
    {
        Calendar cal = Calendar.getInstance();
        cal.setTime(date);
        cal.add(Calendar.DATE, days); //minus number would decrement the days
        return cal.getTime();
    }

	/*
	 * Funzione che si occupa di prendere tutte le timbrature e comporre la riga nella tabella degli orari,
	 * raggruppando tutte le timbrature del giorno
	 */
	@SuppressWarnings("deprecation")
	public void posizionaOrari(Date dataMin, Date dataMax) throws Exception {
		// Selezione di tutti i dipendenti
		TypedQuery<Dipendente> queryDip = DBHandler.getEntityManager().createQuery("SELECT D FROM Dipendente D",Dipendente.class);
		// Per ogni dipendente e per ogni data, tra quella minima e quella massima, si compongono gli orari
		for(Object d:queryDip.getResultList().toArray()) {
			Date dateCur = new Date();
			dateCur=dataMin;
			while(dateCur.compareTo(dataMax)<=0) {
				DBHandler.getEntityManager().getTransaction().begin();
				// Selezione dell'orario relativo al dipendente selezionarto
				TypedQuery<Orario> queryOrario = DBHandler.getEntityManager().createQuery("SELECT O FROM Orario O JOIN O.dipendente D WHERE D.IDBadge='" + 
						((Dipendente)d).getIDBadge() + "'",Orario.class);
				// Selezione dell'orario del dipendente selezionato e per la data considerata
				Orario tbMod = null;
				for(Object o: queryOrario.getResultList().toArray()) {
					Date dataOrario = addDays(((Orario)o).getData(),-1);
					dataOrario.setHours(0);
					dataOrario.setMinutes(0);
					dataOrario.setSeconds(0);
					dateCur.setHours(0);
					dateCur.setMinutes(0);
					dateCur.setSeconds(0);
					if(dataOrario.equals(dateCur)) {
						tbMod = (Orario)o;
						break;
					}
				}
				if (tbMod==null) throw new Exception("Errore nell'inserimento dei dati");
				// Selezione delle timbrature del dipendente selezionato
				TypedQuery<Timbratura> queryTimbratura = DBHandler.getEntityManager().createQuery("SELECT T FROM Timbratura T JOIN T.dipendente D WHERE " +
						"D.IDBadge='" + 	((Dipendente)d).getIDBadge() + "' ORDER BY T.IDTimbratura ASC",Timbratura.class);
				// Selezione delle sole timbrature della data selezionata
				ArrayList<Timbratura> orari = new ArrayList<Timbratura>();
				for(Object o: queryTimbratura.getResultList().toArray()) {
					Date DataTimbratura = addDays(((Timbratura)o).getData(),-1);
					DataTimbratura.setHours(0);
					DataTimbratura.setMinutes(0);
					DataTimbratura.setSeconds(0);
					dateCur.setHours(0);
					dateCur.setMinutes(0);
					dateCur.setSeconds(0);
					if(DataTimbratura.equals(dateCur)) {
						orari.add((Timbratura)o);
					}
				}				
				// Impostazione degli orari
				if(orari.size()>=1 && orari.get(0).getOra()!=null)
					tbMod.setIngresso1(orari.get(0).getOra());
				if(orari.size()>=2 && orari.get(1).getOra()!=null)
					tbMod.setUscita1(orari.get(1).getOra());
				if(orari.size()>=3 && orari.get(2).getOra()!=null)
					tbMod.setIngresso2(orari.get(2).getOra());
				if(orari.size()>=4 && orari.get(3).getOra()!=null)
					tbMod.setUscita2(orari.get(3).getOra());
				// Salvataggio dei dati
				DBHandler.getEntityManager().getTransaction().commit();				
				// Passaggio al giorno successivo
				dateCur = addDays(dateCur,1);
			}
		}		
	}

	/*
	 * Funzione per l'arrotondamento al 0,5 più vicino
	 */
	public static double roundToHalf(double d) {
	    return Math.round(d * 2) / 2.0;
	}

	/*
	 * Funzione per l'elaborazione degli orari e calcolo di ordinari, straordinari, ferie e permessi
	 */
	@SuppressWarnings("deprecation")
	public void elaboraOrari(Date dataMin, Date dataMax) {
		TypedQuery<Orario> queryOrario = DBHandler.getEntityManager().createQuery("SELECT O FROM Orario O",Orario.class);
		for(Object orari:queryOrario.getResultList().toArray()) {
			DBHandler.getEntityManager().getTransaction().begin();
			// Scorrimento di tutti gli orari inseriti e selezione delle sole righe con la data compresa
			// tra quella minima e quella massima
			Date DataOrario = addDays(((Orario)orari).getData(),-1);
			if(DataOrario.compareTo(dataMax)<=0 && DataOrario.compareTo(dataMin)>=0) {
				// Impostazione delle ore di ordinario
				double oreOrd = 0;
				if (((Orario)orari).getIngresso1()!=null && ((Orario)orari).getUscita1()!=null) 
					// Controllo se sono a cavallo della mezzanotte
					if ((((Orario)orari).getUscita1().getHours()-1 < 0 ? 23 : ((Orario)orari).getUscita1().getHours()-1)<(((Orario)orari).getIngresso1().getHours()-1 < 0 ? 23 : ((Orario)orari).getIngresso1().getHours()-1)) 
						oreOrd += (new Time(23,59,59).getTime() - ((Orario)orari).getIngresso1().getTime()) + (((Orario)orari).getUscita1().getTime()-new Time(0,0,0).getTime());
					else
						oreOrd += ((Orario)orari).getUscita1().getTime()-((Orario)orari).getIngresso1().getTime();
				if (((Orario)orari).getIngresso2()!=null && ((Orario)orari).getUscita2()!=null) 
					oreOrd += ((Orario)orari).getUscita2().getTime()-((Orario)orari).getIngresso2().getTime();
				oreOrd /= 3600000;				// Espresso in ore
				((Orario)orari).setOre_Ordinario(roundToHalf(oreOrd) > 8 ? 8 : roundToHalf(oreOrd));
				// Impostazione delle ore di straordinario
				((Orario)orari).setOre_Straordinario(roundToHalf(oreOrd)<=8 ? 0 : roundToHalf(oreOrd) - 8);
				// Impostazione delle ore di malattia
				((Orario)orari).setOre_Malattia(0);
				// Impostazione delle ore di ferie/Permessi
				((Orario)orari).setOre_FeriePermessi(8-((Orario)orari).getOre_Ordinario());
			}
			DBHandler.getEntityManager().getTransaction().commit();
		}
	}

	/*
	 * Funzione che svuota la tabella temporanea delle timbrature, dopo aver elaborato tutti i dati
	 */
	public void eliminaDatiTimbrature() {
		try {
			DBHandler.getEntityManager().getTransaction().begin();
			DBHandler.getEntityManager().createQuery("DELETE FROM Timbratura").executeUpdate();
			DBHandler.getEntityManager().getTransaction().commit();
		} catch (Exception e) {
			e.printStackTrace();
		}
	}
}

package gestioneOrariApplication;

import java.io.FileReader;
import java.util.List;

import javax.swing.JOptionPane;
import javax.xml.parsers.SAXParser;
import javax.xml.parsers.SAXParserFactory;

import org.xml.sax.InputSource;

import gestioneOrariData.Timbratura;

public class RecordParser implements XMLParser<List<Timbratura>> {

	@Override
	/* 
	 * Metodo che si occupa di fare il parsing del file XML passato dalla selezione dalla GUI.
	 * 
	 * @param filePath è il percorso del file che si vuole caricare
	 * @return ritorna la lista contenente tutte le timbrature parsate
	 */
	public List<Timbratura> parserXML(String filePath) {
		try {
			SAXParserFactory factory = SAXParserFactory.newInstance();
			SAXParser saxParser = factory.newSAXParser();
			XMLHandler recordHandler = new XMLHandler();
			saxParser.parse(new InputSource(new FileReader(filePath)), recordHandler);
			return recordHandler.getRecordList();
		}
		catch (Exception e) {
			JOptionPane.showMessageDialog(null, 
                    "Errore nel formato del file", "Errore", JOptionPane.ERROR_MESSAGE);
			e.printStackTrace();
			return null;
		}
	}

}

package gestioneOrariApplication;

import java.awt.event.ActionEvent;
import java.awt.event.ActionListener;
import java.sql.Date;
import java.sql.Time;
import javax.persistence.TypedQuery;
import javax.swing.JFrame;
import javax.swing.JOptionPane;
import javax.swing.table.TableModel;
import gestioneOrariData.Dipendente;
import gestioneOrariData.Timbratura;

/*
 * Listener che si occupa di gestire il click sul pulsante "Salva" nella maschera di visualizzazione 
 * degli orari grezzi importati dall'XML
 */
public class SalvaDatiGrezziActionListener implements ActionListener{

	JFrame parentFrame;
	TableModel tabella;

	public SalvaDatiGrezziActionListener(JFrame parentFrame, TableModel tabella) {
		this.parentFrame=parentFrame;
		this.tabella=tabella;
	}

	@SuppressWarnings("deprecation")
	@Override
	public void actionPerformed(ActionEvent e) {
		Timbratura tempTimb;
		RecordAggregator ra=new RecordAggregator();
		try {	   
			// Creazione degli oggetti di classe Timbratura e implementazione della persistenza
			// delle modifiche
			for(int i=0;i<tabella.getRowCount();i++) {
				// Check sulla compilazione di tutti i campi
				if (tabella.getValueAt(i, 0).toString().equals("") || tabella.getValueAt(i, 1).toString().equals("") ||
						tabella.getValueAt(i, 2).toString().equals("") || tabella.getValueAt(i, 3).toString().equals(""))
					continue;

				tempTimb = new Timbratura();
				// Impostazione data, con controllo preventivo sul formato
				DateValidator.isThisDateValid(tabella.getValueAt(i, 2).toString(), "dd/MM/yyyy");
				tempTimb.setData(new Date(Integer.parseInt(tabella.getValueAt(i, 2).toString().substring(6, 10))-1900,
						Integer.parseInt(tabella.getValueAt(i, 2).toString().substring(3, 5))-1,
						Integer.parseInt(tabella.getValueAt(i, 2).toString().substring(0, 2))+1));

				// Impostazione ora, con controllo preventivo sul formato
				TimeValidator.validate(tabella.getValueAt(i, 3).toString());
				tempTimb.setOra(new Time(Integer.parseInt(tabella.getValueAt(i, 3).toString().substring(0, 2))+1,
										  Integer.parseInt(tabella.getValueAt(i, 3).toString().substring(3,5)),
										  Integer.parseInt(tabella.getValueAt(i, 3).toString().substring(6,8))));

				// Impostazione tipo di timbratura
				tempTimb.setTipo(tabella.getValueAt(i,1).toString());

				// Impostazione del dipendente
				TypedQuery<Dipendente> query = DBHandler.getEntityManager().createQuery("SELECT d FROM Dipendente d WHERE d.IDBadge='" + 
						tabella.getValueAt(i,0).toString() + "'",Dipendente.class);
				if (query.getResultList().isEmpty() || query.getResultList().size()>1) throw new Exception("Nessun dipendente trovato corrispondente"
						+ "al badge inserito");
				tempTimb.setDipendente(query.getResultList().get(0));

				// Salvataggio delle modifiche nel database, per la persistenza
				DBHandler.getEntityManager().getTransaction().begin();
				DBHandler.getEntityManager().persist(tempTimb);
				DBHandler.getEntityManager().getTransaction().commit();
			}
			// Aggregazione degli orari 
			ra.aggregate();
			// Chiusura della maschera
			parentFrame.setVisible(false);
			parentFrame.dispose();
		} catch (Exception ex) {
			JOptionPane.showMessageDialog(null, 
                    "Errore nell'importazione dei dati nel database! Controllare il formato di date ed orari", 
                    "Errore operazione", JOptionPane.ERROR_MESSAGE);
	    }
	}

}

package gestioneOrariApplication;

import java.util.regex.Matcher;
import java.util.regex.Pattern;

/*
 * Classe utilizzata per validare gli orari inseriti ed, in caso, permettere la modifica
 */
public class TimeValidator{

	  private static Pattern pattern;
	  private static Matcher matcher;
	  // Espressione regolare che deve essere matchata
	  private static final String TIME24HOURS_PATTERN = "(0[0-9]|1[0-9]|2[0-3]):[0-5][0-9]:[0-5][0-9]";

	  /**
	   * Validate time in 24 hours format with regular expression
	   * @param time time address for validation
	   * @return true valid time fromat, false invalid time format
	   */
	  public static void validate(final String time) throws Exception{
		  pattern = Pattern.compile(TIME24HOURS_PATTERN);
		  matcher = pattern.matcher(time);
		  if (!matcher.matches()) throw new Exception("Formato orario errato");	    	    
	  }
}

package gestioneOrariApplication;

import java.sql.Time;
import java.util.ArrayList;
import java.util.Date;
import java.util.List;
import javax.persistence.TypedQuery;
import org.xml.sax.Attributes;
import org.xml.sax.SAXException;
import org.xml.sax.helpers.DefaultHandler;

import gestioneOrariData.Dipendente;
import gestioneOrariData.Timbratura;

public class XMLHandler extends DefaultHandler{

	private XMLTag tag = XMLTag.NOTAG; 
	private Date dataXML;
	private List<Timbratura> listaTimbrature = new ArrayList<Timbratura>();
	private Timbratura tempRecord = new Timbratura();

	@SuppressWarnings("deprecation")
	@Override 
	public void startElement(String uri, String localName, String qName, Attributes attributes) throws SAXException { 
		// Identificazione del nome del Tag incontrato
		switch (qName) {
			case "records": 
				tag = XMLTag.RECORDS; 
				dataXML = new Date(Integer.parseInt(attributes.getValue("date").toString().substring(6, 10))-1900,
								Integer.parseInt(attributes.getValue("date").toString().substring(3, 5))-1,
								Integer.parseInt(attributes.getValue("date").toString().substring(0, 2)));	
				break;
			case "record": tag = XMLTag.RECORD; 
				tempRecord = new Timbratura();
				tempRecord.setData(dataXML);
				tempRecord.setTipo(attributes.getValue("type"));
				break;
			case "badgeID": tag = XMLTag.BADGEID; break;
			case "time": tag = XMLTag.TIME; break;
			default: break;
		}
	}

	@SuppressWarnings("deprecation")
	@Override 
	public void characters(char[] ch, int start, int length) throws SAXException { 
		String content = new String(ch, start, length);
		// In base al tag letto, si imposta il valore corretto per il campo dell'oggetto
		switch (tag) {
			case BADGEID:
				TypedQuery<Dipendente> query = DBHandler.getEntityManager().createQuery("SELECT d FROM Dipendente d WHERE d.IDBadge='" + content + "'",Dipendente.class);
				if (query.getResultList().isEmpty() || query.getResultList().size()>1) throw new SAXException();
				tempRecord.setDipendente(query.getResultList().get(0));
				break;
			case TIME:
				tempRecord.setOra(new Time(Integer.parseInt(content.substring(0, 2)),
										  Integer.parseInt(content.substring(3,5)),
										  Integer.parseInt(content.substring(6,8))));
				break;
			default: break;
		}
	}

	@Override 
	public void endElement(String uri, String localName, String qName) throws SAXException {
		switch (tag) {
			case TIME:
				// Aggiunta della timbratura generata alla lista
				listaTimbrature.add(tempRecord);
			default:
				tag=XMLTag.NOTAG;
		}			
	}

	public List<Timbratura> getRecordList() {
		  return listaTimbrature;
	}

}

package gestioneOrariApplication;

public interface XMLParser<T> {
	public T parserXML(String filePath);
}

package gestioneOrariApplication;

public enum XMLTag {
	NOTAG, RECORDS, RECORD, BADGEID, TIME;
}
